import React from "react";
import { FaCartArrowDown } from "react-icons/fa";
import { Link } from "react-router-dom";
const Navbar = () => {
  return (
    <section>
      <p>All-Hadi</p>
      <nav>
        <Link to="/">Home</Link>
        <Link to="/">Login</Link>
        <Link to="/">Sign-Up</Link>
      </nav>
      <Link to="/cart">
        <FaCartArrowDown />
      </Link>
    </section>
  );
};

export default Navbar;
